INSERT INTO `_help` VALUES (1,5,13,'<b>Calendrier</b>\r\n\r\n<i><u>Description</u></i>\r\nLe calendrier permet de choisir des activités (mandats et/ou absences) pour une semaine et de saisir les quantités (en général des heures) pour ces activités.\r\n\r\nUne liste apparait sur des mandats contenant des règles contractuelles (Mandat > Mandat) auquel des quantités peuvent être saisies.\r\n\r\nPour chaque activité, il est possible de saisir des types de frais que l\'on aura choisis auparavant.\r\n\r\nUn onglet « Frais » permet de lister les types de frais choisis et de saisir les montant par activité.\r\n\r\nPour les absences, aucun frais ne peut être saisi.\r\n\r\nPour la semaine qui est affiché, si un congé officiel existe (voir Admin > Congé officiel), le jour est affiché en rouge.\r\n\r\n<i><u>Action</u></i>\r\nUne action « Copier » permet de copier la semaine qui est affiché pour une autre semaine.\r\n\r\nUne croix à gauche des mandats permet de supprimer un mandat avec ces activités et articles.'),(2,5,23,'<b>Vacances et absences</b>\r\n\r\n<i><u>Description</u></i>\r\nLes vacances et absences reprend exactement le même principe que « Calendrier » sauf qu\'il s\'agit d\'une planification des vacances et/ou absences.\r\n\r\nSi pour une semaine des vacances et/ou absences ont été planifié, lorsque l\'on ira dans le calendrier pour cette semaine, nous verrons automatique ce qui a été planifié.\r\n\r\n<i><u>Action</u></i>\r\nUne croix à gauche des absences permet de supprimer une absence.'),(3,2,1,'<b>Client</b>\r\n\r\n<i><u>Description</u></i>\r\nLe client est l\'entité auquel il est attaché à un mandat.\r\nUn client peut avoir plusieurs personnes de contact.\r\n\r\n<i><u>Action</u></i>\r\nPlusieurs actions ont été intégrées afin de pouvoir accéder aux différents modules plus rapidement.\r\n\r\n« Nouveau client » permet de saisir un nouveau client.\r\n« Nouveau mandat » permet de saisir un nouveau mandat pour le client en question.\r\n« Supprimer » permet de supprimer un client.\r\n\r\nUne liste des mandats pour ce client est affichée et permet :\r\n- d\'éditer un mandat\r\n- d\'accéder au rapport du mandat\r\n- d\'accéder à la facturation du mandat'),(4,5,28,'<b>Validation</b>\r\n\r\n<i><u>Description</u></i>\r\nLa validation permet de valider les quantités et les frais du calendrier entre deux dates.\r\n\r\nUne fois que les quantités et les frais ont été validés, il n\'est plus possible de modifier les données dans le calendrier.\r\n\r\nSi des congés officiels existent entre les deux dates, les jours apparaissent en rouge.\r\nSi des absences existent entre les deux dates, les jours apparaissent en orange.\r\n\r\n<i><u>Action</u></i>\r\nUne action « Valider » valide les données entre les deux dates choisis et ne permet plus de les modifier.\r\n\r\nUne action « Libérer » libère les données entre les deux dates choisis et permet de les modifier.'),(5,7,20,'<b>Rapport collaborateur</b>\r\n\r\n<i><u>Description</u></i>\r\nLe rapport collaborateur permet d\'afficher trois types de rapport:\r\n« Heures », « Vacances et absences » et « Frais »\r\n\r\nLes « Heures » affichent les activités saisies et validés du calendrier pour les dates choisies.\r\n\r\nLes « Vacances et absences » affichent les données du calendrier depuis le début de l\'année jusqu\'à aujourd\'hui et les données de planification (en orange) depuis demain jusqu\'à la fin de l\'année.\r\n\r\nLes « Frais » affichent la somme total des frais (tous types) validé pour un collaborateur et pour les dates choisies.\r\nIl affiche également  le total pour chaque type de frais.\r\n\r\n<i><u>Action</u></i>\r\nUne action « Chercher » permet d\'afficher les données par rapport aux critères saisies.'),(6,4,5,'<b>Mandat</b>\r\n\r\n<i><u>Description</u></i>\r\nLe mandat est l\'entité principal de l\'application auquel un client est rattaché, des heures sont saisie et des factures sont réalisées.\r\n\r\nUn onglet « Collaborateur » permet d\'attribuer des collaborateurs pour le mandat en question. De plus, chaque collaborateur est affecté à toutes les activités ou que certaines.\r\n\r\nUn onglet « Heures sup » permet de créer des règles contractuelles (ex. jours fériés) avec un taux.\r\n\r\n<i><u>Action</u></i>\r\nUne liste contenant toutes les règles (Admin > Heures sup) permet d\'en ajouter une.\r\n\r\nUne action « Facturation » permet d\'accéder à la facturation pour le mandat en question.\r\n\r\nUne action « Supprimer » permet de supprimer un mandat.'),(7,4,19,'<b>Gestion des activités</b>\r\n\r\n<i><u>Description</u></i>\r\nLa gestion des activités permet de choisir un mandat et de saisir les quantités (en général des heures) pour ce mandat ainsi que des notes.\r\n\r\nUne liste des notes est affiché par date avec le libellé et le commentaire.\r\n\r\nUne liste des activités est affiché par date décroissante avec la quantité, la description de l\'activité, le tarif et le collaborateur.\r\n\r\n<i><u>Action</u></i>\r\nUn bouton au dessus de la liste des notes permet d\'ajouter une note.\r\n\r\nPour chaque note entré, l\'on peut la modifier et/ou la supprimer.\r\n\r\nUne liste contenant toutes les activités (Admin > Activité) permet d\'en ajouter une. Si une activité n\'est pas présente dans la liste, un bouton à coté de la liste permet de l\'ajouter.\r\n\r\nPour chaque activité saisie, l\'on peut la modifier et/ou la supprimer.\r\n\r\nUne action « Facturation » permet d\'accéder à la facturation pour le mandat en question.\r\n\r\nUne action « Rapport » permet d\'accéder au rapport du mandat en question.'),(8,7,21,'<b>Rapport client</b>\r\n\r\n<i><u>Description</u></i>\r\nLe rapport client permet d\'afficher le « Rapport d\'activité » d\'un client pour les dates choisies.\r\n\r\n<i><u>Action</u></i>\r\nUne action « Chercher » permet d\'afficher les données par rapport aux critères saisies.'),(9,7,22,'<b>Rapport mandat</b>\r\n\r\n<i><u>Description</u></i>\r\nLe rapport mandat permet d\'afficher deux types:\r\n« Décompte global » et « Décompte heures ».\r\n\r\nLe « Décompte global » est une somme des activités avec les montants d\'un client pour pour les dates choisies.\r\n\r\nLe « Décompte heures » affiche les heures des activités du client pour les dates choisies.\r\n\r\n<i><u>Action</u></i>\r\nUne action « Chercher » permet d\'afficher les données par rapport aux critères saisies.\r\n\r\nUne action « Pdf » apparait seulement sur le « Décompte heures » et permet de télécharger un fichier PDF. Les données du fichier PDF est identique à l\'affichage sur l\'écran.'),(10,7,27,'<b>Rapport frais</b>\r\n\r\n<i><u>Description</u></i>\r\nLe rapport frais est identique au type « Frais » du rapport collaborateur'),(11,6,18,'<b>Document</b>\r\n\r\n<i><u>Description</u></i>\r\nLe document permet de créer une facture ou une offre basé sur un client et un mandat.\r\n\r\nPour un client et un mandat sélectionné, une liste des activités et/ou articles est affiché contenant le total des quantités, les tarifs, la TVA et les montants.\r\n\r\nCes données proviennent du calendrier.\r\nSi un mandat est un forfait, les données saisies dans le mandat apparaissent.\r\n\r\nCes données peuvent être modifié à votre guise (ex. arrondi) et n\'impacte en aucun cas les données saisies dans le calendrier par les collaborateurs ou dans le mandat.\r\n\r\nUne date de début et de fin peuvent être choisies (ex. facturation pour un mois).\r\n\r\nL\'onglet « Pdf » affiche toutes les facture du document en question et peuvent être téléchargé et imprimé.\r\n\r\n<i><u>Action</u></i>\r\nUne action « Supprimer » permet de supprimer un document.'),(12,6,24,'<b>Paiement</b>\r\n\r\n<i><u>Description</u></i>\r\nLe paiement est une liste de document non validé auquel des paiements reste à venir.\r\n\r\n<i><u>Action</u></i>\r\nUne action « Nouvelle facture » permet de créer un nouveau document.\r\n\r\nSur chaque ligne, une action permet d\'éditer le document en question et une autre de générer une facture intermédiaire.\r\n\r\nLa facture intermédiaire est identique à la facture initiale du document plus le(s) paiement(s) déjà effectué et le montant restant à payer.'),(13,3,12,'<b>Société</b>\r\n\r\n<i><u>Description</u></i>\r\nDans société apparait les informations de la dite société.\r\nIl y a une et une seule société.\r\n\r\nL\'onglet gestion permet de saisir les montants des assurances de la société pour une année choisie.'),(14,3,16,'<b>Collaborateur</b>\r\n\r\n<i><u>Description</u></i>\r\nUn collaborateur est une personne travaillant dans la société définis (Admin > Société).\r\n\r\nL\'onglet contrat permet de saisir les informations contractuelles du collaborateur.\r\n\r\n<i><u>Action</u></i>\r\nUne action « Supprimer » permet de supprimer un collaborateur.'),(15,3,17,'<b>Prime</b>\r\n\r\n<i><u>Description</u></i>\r\nDans prime apparait des montants relatifs à la société.\r\n\r\nL\'onglet collaborateur permet d\'ajout des collaborateurs ayant droit à une prime.\r\n\r\nPour chaque collaborateur des informations sont rentrées affin d\'aider au calcul de la prime.\r\n\r\n<i><u>Action</u></i>\r\nUne action « Supprimer » permet de supprimer une prime.'),(16,3,29,'<b>Heures sup.</b>\r\n\r\n<i><u>Description</u></i>\r\nUne heure sup est une règle contenant un taux pour calculé le surplus du tarif lors d\'une facturation d\'un client si pour celui-ci des quantités ont été saisie dans le calendrier.\r\n\r\nLors d\'un ajout d\'une règle dans un mandat, le taux peut être changé.\r\n\r\nLe taux se trouvant sur cette page, permet de calculer le nombre de jour de vacance d\'un collaborateur qui aurait effectué des heures sup. sur un mandat.\r\n\r\n<i><u>Action</u></i>\r\nUne action « Supprimer » permet de supprimer une heure sup.'),(17,3,7,'<b>Activité</b>\r\n\r\n<i><u>Description</u></i>\r\nUne activité est définis dans un mandat (Mandat > Mandat) et apparait dans le calendrier et dans la gestion des activités pour la saisie des quantités.\r\n\r\n<i><u>Action</u></i>\r\nUne action « Supprimer » permet de supprimer une activité.'),(18,3,6,'<b>Article</b>\r\n\r\n<i><u>Description</u></i>\r\nUn article apparait sous une activité définis dans un mandat (Mandat > Mandat) ainsi que dans le calendrier pour la saisie des quantités.\r\n\r\n<i><u>Action</u></i>\r\nUne action « Supprimer » permet de supprimer un article.'),(19,3,26,'<b>Type quantité</b>\r\n\r\n<i><u>Description</u></i>\r\nUn type quantité permet de définir de quel type (ex. heures, forfait, etc...) sont les mandats, les activités et les articles.\r\n\r\n<i><u>Action</u></i>\r\nUne action « Supprimer » permet de supprimer un type quantité.'),(20,3,8,'<b>Congé officiel</b>\r\n\r\n<i><u>Description</u></i>\r\nLes congés officiels sont les jours dans l\'année auquel nous ne travaillons pas.\r\n\r\nIl peuvent être « Fédéral » ou « Cantonal ».\r\n\r\nCes congés officiel sont visible dans le calendrier, dans les vacances et absences et dans la validation. Les jours en question apparaissent en rouge.\r\n\r\n<i><u>Action</u></i>\r\nUne action « Supprimer » permet de supprimer un congé officiel.\r\n\r\nUne action « Copier » permet de copier les congés officiels d\'une année à une autre.'),(21,3,9,'<b>Absence</b>\r\n\r\n<i><u>Description</u></i>\r\nUne absence est ce qui est sélectionné dans le calendrier et/ou dans vacances et absences.\r\n\r\n<i><u>Action</u></i>\r\nUne action « Supprimer » permet de supprimer une absence.'),(22,3,30,'<b>Frais</b>\r\n\r\n<i><u>Description</u></i>\r\nLes frais sont les différents type de frais pouvant être sélectionné et saisie dans le calendrier (Calendrier > Calendrier).\r\n\r\n<i><u>Action</u></i>\r\nUne action « Supprimer » permet de supprimer un type de frais.'),(23,3,10,'<b>Monnaie</b>\r\n\r\n<i><u>Description</u></i>\r\nLa monnaie est la devise des montants de l\'application.\r\n\r\nUn onglet « Cours » permet de saisir un taux de change à une date donnée.\r\n\r\n<i><u>Action</u></i>\r\nUne action « Supprimer » permet de supprimer une monnaie et tous ces cours.'),(24,3,14,'<b>Rappel</b>\r\n\r\n<i><u>Description</u></i>\r\nLe rappel est utilisé pour les document (Facturation > Document).\r\n\r\nIl permet d\'obtenir des frais de rappel suite à une facture non payé après n jours.\r\n\r\n<i><u>Action</u></i>\r\nUne action « Supprimer » permet de supprimer un rappel.'),(25,3,15,'<b>Nouvelle année</b>\r\n\r\n<i><u>Description</u></i>\r\nLa nouvelle année permet de générer tous les jours de l\'année en question.\r\n\r\nCeci afin de pouvoir les lier dans certain module de l\'application.\r\nEx. Calendrier, Vacances et absences, Gestion des activités, etc...'),(26,3,25,'<b>Changer le mot de passe</b>\r\n\r\n<i><u>Description</u></i>\r\nChaque utilisateur peut changer son mot de passe à cet endroit.'),(27,3,3,'<b>Rôle</b>\r\n\r\n<i><u>Description</u></i>\r\nLe rôle permet de donner les accès aux différents menus de l\'application.\r\n\r\nLorsqu\'un utilisateur se connecte à l\'application, le menu peut varier d\'un rôle à l\'autre. Cela dépend des accès que l\'on lui donne.\r\n\r\n<i><u>Action</u></i>\r\nUne action « Supprimer » permet de supprimer un rôle.'),(28,3,4,'<b>Utilisateur</b>\r\n\r\n<i><u>Description</u></i>\r\nL\' utilisateur permet de se connecter à l\'application.\r\n\r\nUn rôle ainsi qu\'un collaborateur est attribué à l\'utilisateur.\r\n\r\nCependant, l\'attribution au collaborateur n\'est pas obligatoire (ex. admin).\r\n\r\n<i><u>Action</u></i>\r\nUne action « Supprimer » permet de supprimer un utilisateur.');
/*!40000 ALTER TABLE `_help` ENABLE KEYS */;
UNLOCK TABLES;

